import React, { useState } from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './app';
import Loading from './loading';

const [status,setStatus] = useState('app');

const render = () => {
  switch(status) {
    case 'app':
      return <App/>

    default:
      return <App/>
  }
}
ReactDOM.render(
  <React.StrictMode>
   {render()}
    {/* <App/> */}
    {/* <Loading/> */}
  </React.StrictMode>,
  document.getElementById('root')
);
